import classes from './EducationContent.module.css';

const EducationContent = () => {
    return(
        <div>
            <div>
                <div className={classes.degree}>
                    <img src="https://www.freepnglogos.com/uploads/graduation-cap/graduation-cap-clipart-invenio-30.png" width="450" alt="graduation cap transparent download best graduation" />
                </div>
                <div>
                    <div className={classes.degreecontent}>
                        <h2>Education</h2>
                        <h3>Basic Qulification and Certifications</h3>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default EducationContent;
